import "./App.css"
import { useEffect, useState } from "react"
import axios from "axios"

const App = () => {
  const [countries, setCountries] = useEffect([])
  const fetchData = () => {
    const data = axios
      .get("https://restcountries.com/v3.1/all")
      .then((response) => response.data)
    return data
  }
  useEffect(() => {
    const data = fetchData()
  })
}

export default App
